package main

import "fmt"

// https://leetcode-cn.com/problems/is-subsequence/

func isSubsequence(s string, t string) bool {
	index := 0
	for _, ss := range s {
		// 此处可以优化，从i直接开始操作，不用每次都从0开始
		fl, ok := isContain(index, ss, t)
		if !ok {
			return false
		}
		index = fl
	}
	return true
}

func isContain(index int, s rune, t string) (int, bool) {
	for j, tt := range t {
		if tt == s && (j > index || (j == 0 && j == index)) {
			return j, true
		}
	}
	return 0, false
}

func main() {
	fmt.Println(isSubsequence("leeeeetcode", ""))
}
